{
	$focus: { filter: 'invert(0.2) saturate(2) brightness(1.1)' },
	$hover: { filter: 'invert(0.15) saturate(1.5) brightness(1.1)' },
}

(
	<Host>
		<Style>
			{{
				$: {
					position: 'relative',
					color: 'onSurface',
					display: 'block',
				},
				container: {
					position: 'relative',
					...padding(0, 12, 4, 12),
				},
				$focused: { borderColor: 'primary' },
				$outline: {
					borderColor: 'onSurface',
					borderWidth: 1,
					borderStyle: 'solid',
					borderRadius: 4,
					marginTop: 2,
					paddingTop: 14,
					paddingBottom: 12,
				},
				$outline$focused: {
					boxShadow: boxShadow(0, 0, 0, 1, 'primary'),
				},
				$focused$outline: {
					borderColor: 'primary',
				},
				$invalid: { color: 'error' },
				$invalid$outline: { borderColor: 'error' },
				$invalid$outline$focused: {
					boxShadow: boxShadow(0, 0, 0, 1, 'error'),
				},
				content: {
					display: 'flex',
					position: 'relative',
					font: 'default',
					marginTop: 2,
				},
				mask: {
					position: 'absolute',
					top: 0,
					right: 0,
					left: 0,
					bottom: 0,
					backgroundColor: 'onSurface8',
				},
				mask$outline: { borderRadius: 4 },
				mask$hover: {
					filter: 'invert(0.15) saturate(1.5) brightness(1.1)',
				},
				mask$hover$disabled: { filter: 'none' },
				label: {
					position: 'relative',
					font: 'caption',
					lineHeight: 10,
					verticalAlign: 'bottom',
				},
				label$focused: { color: 'primary' },
				label$invalid: { color: 'error' },
				label$outline: {
					position: 'absolute',
					translateY: -26,
					translateX: -4,
					paddingLeft: 4,
					paddingRight: 4,
					backgroundColor: 'surface',
					display: 'inline-block',
				},
				label$floating$novalue: {
					font: 'default',
					translateY: 20,
					opacity: 0.75,
				},
				label$leading: { paddingLeft: 24 },
				label$floating$novalue$outline: { translateY: 27 },
			}}
		</Style>
		<div className="container">
			<div className="mask"></div>
			<div className="label">
				<Slot selector="cxl-label" />
			</div>
			<div className="content">
				<slot />
			</div>
		</div>
	</Host>
)

((r: any) => {
	for (let i = 12; i > 0; i--)
		r.xl['$xl' + i] = r.lg['$lg' + i] = r.md['$md' + i] = r.sm[
			'$sm' + i
		] = r.xs['$xs' + i] = {
			display: 'block',
			gridColumnEnd: 'span ' + i,
		};
	return r;
})({
	xl: {},
	lg: {},
	md: {},
	sm: {},
	xs: {},
})

new Promise((resolve, reject) => {
		this.resolve = resolve;
		this.reject = reject;
	})

